import React from 'react'
import CommonHeader from '../../component/CommonHeader'
import MyInput from '../../component/MyInput'
import SearchList from './SearchList'

export default function index(props) {
  return (
    <div>
        {/* 公共头部 */}
        <CommonHeader>
            <MyInput/>
        </CommonHeader>
        {/* 搜索列表 */}
        <SearchList/>
    </div>
  )
}
